4. 多态的本质
　　Java调用的详细流程:
4.1 编译器查看对象的声明类型和方法名。
　　假设调用obj.func(param)，obj为Cat类的对象。有可能存在多个名字为func但参数签名不一样的方法。例如，可能存在func(int)和func(String)。编译器会列举所有Cat类中名为func的方法和其父类Animal中访问属性为public且名为func的方法。
　　这样，编译器就获得了所有可能被调用的候选方法列表。
4.2 接下来，编泽器将检查调用方法时提供的参数签名。
　　如果在所有名为func的方法中存在一个与提供的参数签名完全匹配的方法，那么就选择这个方法。这个过程被称为重载解析(overloading resolution)。
　　例如，如果调用func("hello")，编译器会选择func(String)，而不是func(int)。由于自动类型转换的存在，如果没有找到与调用方法参数签名相同的方法，就进行类型转换后再继续查找，如果最终没有匹配的类型或者有多个方法与之匹配，那么编译错误。
4.3 静态绑定与动态绑定
　　如果方法的修饰符是private、static、final，或是构造方法，那么编译器可准确知道该调用哪个方法，这种调用方式称为静态绑定(static binding)。
　　当程序运行，且釆用动态绑定调用方法时，JVM会调用与obj所引用对象的实际类型最合适的那个类的方法。我们假设obj实际类型是Cat，是Animal子类，如果 Cat中定义func(String)，就调用它，否则将在Animal类及其父类中寻找。

　　每次调用方法都要进行搜索，时间开销相当大。因此，JVM预先为每个类创建了一个方法表(method lable)，其中列出了所有方法的名称、参数签名和所属的类。在真正调用方法的时候，虚拟机仅查找这个表就行了。
　　在上面的例子中，JVM搜索Cat类的方法表，以便寻找与调用func("hello")相匹配的方法。注意，如果调用super.func("hello")，编译器将对父类的方法表迸行搜索。
　　假设Animal类包含cry()、getName()、getAge()三个方法，那么它的方法表如下：

cry() -> Animal.cry()
getName() -> Animal.getName()
getAge() -> Animal.getAge()

　　实际上，Animal也有默认的父类Object，会继承Object方法，所以上面列举的方法并不完整。
　　假设Cat类覆盖了Animal类中的cry()方法，且新增了一个方法climbTree()，那么它的参数列表为：

cry() -> Cat.cry()
getName() -> Animal.getName()
getAge() -> Animal.getAge()
climbTree() -> Cat.climbTree()

　　在运行的时候，调用obj.cry()过程如下：

JVM 首先访问obj实际类型的方法表，可能是Animal类的方法表，也可能是Cat类及其子类的方法表。
JVM 在方法表中搜索与cry()匹配的方法 。
JVM 调用该方法。

