String的equals()
1. Solution
public class Test {
    private int num;
    private String data;

    public boolean equals(Object obj) {
        if(this == obj) {
            return true;
        }        
        if((obj == null) || (obj.getClass() != this.getClass())) {
            return false;
        }     
        // object must be Test at this point
        Test test = (Test)obj;
        return num == test.num &&
         (data == test.data || (data != null && data.equals(test.data)));
     }

     public int hashCode() {
         int hash = 7;
         hash = 31 * hash + num;
         hash = 31 * hash + (null == data ? 0 : data.hashCode());
         return hash;
     }

     // other methods
 }

2. getClass() vs instanceof
if((obj == null) || (obj.getClass() != this.getClass())) {
    return false;
}

This conditional check is preferred instead of the conditional check given by 
if(!(obj instanceof Test)) {
    return false; 
}

Because the first condition ensures that it will return false if the argument is a subclass of the class Test. However, in case of the second condition it fails. Thus, it might violate the symmetry requirement of the contract. The instanceof check is correct only if the class is final, so that no subclass would exist. The first condition will work for both, final and non-final classes. 
Key points:

instanceof tests whether the object reference on the left-hand side (LHS) is an instance of the type on the right-hand side (RHS) or some subtype.
getClass() == ... tests whether the types are identical.

class A { }  
class B extends A { }  

Object o1 = new A();  
Object o2 = new B();  

o1 instanceof A => true  
o1 instanceof B => false  
o2 instanceof A => true //  true  

o1.getClass().equals(A.class) => true  
o1.getClass().equals(B.class) => false  
o2.getClass().equals(A.class) => false //  true

3. Guidelines

Use == to check if the argument is the reference to this object. This saves time when actual comparison is costly. 
Cast the method argument to the correct type. Again, the correct type may not be the same class. Also, since this step is done after the above type-check condition, it will not result in a ClassCastException. 
Compare significant variables of both, the argument object and this object and check if they are equal. If all of them are equal then return true, otherwise return false. Again, as mentioned earlier, while comparing these class members/variables; primitive variables can be compared directly with == after performing any necessary conversions (Such as float to Float.floatToIntBits or double to Double.doubleToLongBits). Whereas, object references can be compared by invoking their equals method recursively. You also need to ensure that invoking equals method on these object references does not result in a NullPointerException, as shown in Line 15.
Do not change the type of the argument of the equals method. It takes a java.lang.Object as an argument, do not use your own class instead. If you do that, you will not be overriding the equals method, but you will be overloading it instead; which would cause problems. 
Lastly, do not forget to override the hashCode method whenever you override the equals method.
The class java.lang.StringBuffer does not override the equals method, and hence it inherits the implementation from java.lang.Object class.
If null is passed as an argument to the equals method, it will return false. 
If a class field is not used in equals(), you should not use it in hashCode() method.

4. How to write immutable classes

All of its fields are final and the class is declared final
Any fields that contain references to mutable objects, such as arrays, collections, or mutable classes like Date: 
Are private
Are never returned or otherwise exposed to callers
Are the only reference to the objects that they reference
Do not change the state of the referenced objects after construction



class ImmutableArrayHolder {

  private final int[] theArray;

  // Right way to write a constructor -- copy the array
  public ImmutableArrayHolder(int[] anArray) {
    this.theArray = (int[]) anArray.clone();
  }

  // Wrong way to write a constructor -- copy the reference
  // The caller could change the array after the call to the constructor
  public ImmutableArrayHolder(int[] anArray) {
    this.theArray = anArray;
  }

  // Right way to write an accessor -- don't expose the array reference
  public int getArrayLength() { return theArray.length }
  public int getArray(int n)  { return theArray[n]; }

  // Right way to write an accessor -- use clone()
  public int[] getArray()     { return (int[]) theArray.clone(); }

  // Wrong way to write an accessor -- expose the array reference
  // A caller could get the array reference and then change the contents
  public int[] getArray()       { return theArray }
}

Fundamental/String.html.body:
String
1. What is java string pool?
We know that String is special class in java and we can create String object using new operator as well as providing values in double quotes.
Here is a diagram which clearly explains how String Pool is maintained in java heap space and what happens when we use different ways to create Strings.

String Pool is possible only because String is immutable in Java and it’s implementation of String interning concept. String pool is also example of Flyweight design pattern.
When we use double quotes to create a String, it first looks for String with same value in the String pool, if found it just returns the reference else it creates a new String in the pool and then returns the reference.
However using new operator, we force String class to create a new String object and then we can use intern() method to put it into the pool or refer to other String object from pool having same value.
2. What does String intern() method do?
When the intern() is invoked, if the pool already contains a string equal to this String object as determined by the equals(Object) method, then the string from the pool is returned. Otherwise, this String object is added to the pool and a reference to this String object is returned.
This method always returns a String that has the same contents as this string, but is guaranteed to be from a pool of unique strings.
3. Why String is immutable or final in Java
There are several benefits of String because it’s immutable and final:

String Pool is possible because String is immutable in java. 
It increases security because any hacker can’t change its value and it’s used for storing sensitive information such as database username, password etc. 
ince String is immutable, it’s safe to use in multi-threading and we don’t need any synchronization. 
Strings are used in java classloader and immutability provides security that correct class is getting loaded by Classloader. 

4. Difference between String, StringBuffer and StringBuilder?
String is immutable and final in java, so whenever we do String manipulation, it creates a new String. String manipulations are resource consuming, so java provides two utility classes for String manipulations – StringBuffer and StringBuilder. 
StringBuffer and StringBuilder are mutable classes. StringBuffer operations are thread-safe and synchronized where StringBuilder operations are not thread-safe. 
5. How many String objects got created in below code snippet?
String s1 = new String("Hello"); 
String s2 = new String("Hello");

Answer is 3. First – line 1, “Hello” object in the string pool. Second – line 1, new String with value “Hello” in the heap memory. Third – line 2, new String with value “Hello” in the heap memory. Here “Hello” string from string pool is reused.
6. What are different ways to create String Object?
String str = new String("abc"); 
String str1 = "abc";

When we create a String using double quotes, JVM looks in the String pool to find if any other String is stored with same value. If found, it returns the reference to that String object else it creates a new String object and stores it in the String pool. When we use new operator, JVM creates the String object but don’t store it into the String Pool. We can use intern() method to store the String object into String pool or return the reference if there is already a String with equal value present in the pool.
public class Test {  
    public static void main(String[] args) {  
        String str = "abc";  
        String str1 = "abc";  
        String str2 = new String("abc");  
        System.out.println(str == str1);  
        System.out.println(str1 == "abc");  
        System.out.println(str2 == "abc");  
        System.out.println(str1 == str2);  
        System.out.println(str1.equals(str2));  
        System.out.println(str1 == str2.intern());  
        System.out.println(str2 == str2.intern());  
    }  
}

　　Java语言使用内存时，栈内存主要保存基本数据类型和对象的引用，而堆内存存储对象，栈内存的速度要快于堆内存。 String类的本质是字符数组char[]，其次String类是final的，再次String是特殊的封装类型，使用String时可以直接赋值，也可以用new来创建对象，但是这二者的实现机制是不同的。还有一个 String池的概念，Java运行时维护一个String池，池中的String对象不可重复，没有创建，有则作罢。String池不属于堆和栈，而是属于常量池。
　　下面分析上方代码的真正含义 
String str = "abc";  
String str1= "abc";

　　第一句的含义是在String池中创建一个对象”abc”，然后引用时str指向池中的对象”abc”。第二句执行时，因为”abc”已经存在于 String池了，所以不再创建，则str==str1返回true就明白了。 
String str2 = new String("abc");
　　这句话创建了2个String对象，而基于上面两句，只在栈内存创建str2引用，在堆内存上创建一个String对象，内容是”abc”，而str2指向堆内存对象的首地址。
　　下面就是str2==”abc”的问题了，显然不对，”abc”是位于String池中的对象，而str2指向的是堆内存的String对象，==判断的是地址，肯定不等了。 
　　str1.equals(str2)是对的。String类的equals()重写了Object类的equals()方法，实际就是判断内容是否相同了。 
　　intern()实际上是这样的：该方法现在String池中查找是否存在一个对象，存在了就返回String池中对象的引用。 那么本例中String池存在”abc”，则调用intern()方法时返回的是池中”abc”对象引用，那么和str/str1都是等同的，和str2就不同了，因为str2指向的是堆内存。 
