5. 序列化 ID 问题

情境：两个客户端A和B通过网络传递对象数据，A将对象C序列化再传给B，B反序列化得到C。

问题：C对象的路径假设为com.inout.Test，在A和B端都有这么一个类文件，功能代码完全一致。也都实现了Serializable接口，但是反序列化总是不成功。

解决：虚拟机是否允许反序列化，不仅取决于类路径和功能代码是否一致，重要的一点是两个类的序列化ID是否一致（private static final long serialVersionUID = 1L）。虽然两个类的功能代码完全一致，但是ID不同，他们无法相互序列化和反序列化。


 import java.io.Serializable; 

 public class A implements Serializable { 

     private static final long serialVersionUID = 1L; 
     private String name; 

 }

 import java.io.Serializable; 

 public class A implements Serializable { 

     private static final long serialVersionUID = 2L; 
     private String name; 
 }

　　序列化ID提供两种生成策略，一个是固定的1L，一个是随机生成一个不重复的long数据。通过改变ID可以用来限制某些用户的使用。
6. 父类的序列化与 Transient 关键字

情境：一个子类实现了Serializable接口，它的父类没有实现Serializable 接口，序列化该子类对象，然后反序列化后输出父类定义的某变量的数值，该变量数值与序列化时的数值不同。

解决：要想将父类对象也序列化，就需要让父类也实现Serializable接口。
如果父类不实现，要有默认的无参构造函数。


　　在父类没有实现Serializable接口时，虚拟机不会序列化父对象，而Java对象的构造必须先有父对象，才有子对象，反序列化也不例外。
　　所以为了构造父对象，只能调用父类的无参构造函数作为默认的父对象。因此取父对象的变量值时，它的值是调用父类无参构造函数后的值。如果考虑到这种序列化的情况，在父类无参构造函数中对变量进行初始化，否则的话，父类变量值都是默认声明的值，如int型的默认是0。
　　Transient可以阻止该变量被序列化到文件中，在被反序列化后，transient的值被设为初始值，如int的是0。
7. 对敏感字段加密

情境：服务器端希望对密码字段在序列化时，进行加密，而客户端如果拥有解密的密钥，只有在客户端进行反序列化时，才可以对密码进行读取 。

解决：在序列化过程中，虚拟机会调用对象类里的writeObject和readObject方法，进行用户自定义的序列化和反序列化，如果没有这样的方法，则默认调用是 ObjectOutputStream的defaultWriteObject方法以及ObjectInputStream的defaultReadObject方法。用户自定义的writeObject和readObject方法允许用户控制序列化过程，比如可以在序列化的过程中动态改变序列化的数值。


　　基于这个原理，可以在实际应用中得到使用，用于敏感字段的加密工作。
 private static final long serialVersionUID = 1L;

    private String password = "pass";

    public String getPassword() {
        return password;
    }

    public void setPassword(String password) {
        this.password = password;
    }

    private void writeObject(ObjectOutputStream out) {
        try {
            PutField putFields = out.putFields();
            System.out.println("原密码:" + password);
            password = "encryption";//模拟加密
            putFields.put("password", password);
            System.out.println("加密后的密码" + password);
            out.writeFields();
        } catch (IOException e) {
            e.printStackTrace();
        }
    }

    private void readObject(ObjectInputStream in) {
        try {
            GetField readFields = in.readFields();
            Object object = readFields.get("password", "");
            System.out.println("要解密的字符串:" + object.toString());
            password = "pass";//模拟解密,需要获得本地的密钥
        } catch (IOException e) {
            e.printStackTrace();
        } catch (ClassNotFoundException e) {
            e.printStackTrace();
        }

    }

    public static void main(String[] args) {
        try {
            ObjectOutputStream out = new ObjectOutputStream(
                    new FileOutputStream("result.obj"));
            out.writeObject(new Test());
            out.close();

            ObjectInputStream oin = new ObjectInputStream(new FileInputStream(
                    "result.obj"));
            Test t = (Test) oin.readObject();
            System.out.println("解密后的字符串:" + t.getPassword());
            oin.close();
        } catch (FileNotFoundException e) {
            e.printStackTrace();
        } catch (IOException e) {
            e.printStackTrace();
        } catch (ClassNotFoundException e) {
            e.printStackTrace();
        }
    }

