5.1 并发
　　首先，go提供goroutine作为原生的并发机制。每个goroutine所需的内存很少，实际应用中可以启动大量的goroutine对并发连接进行响应。goroutine遇到IO阻塞，调度器会自动切换到另一个goroutine执行，保证CPU不会因为IO而发生等待。
　　同时，go为goroutine提供了独到的通信机制——channel。channel发生读写的时候，会挂起当前操作channel的goroutine，是一种同步阻塞通信。这样既达到了通信的目的，又实现同步。
