Output:

false, true, false

　　str1和str3都在编译期间生成了字面常量和符号引用，运行期间字面常量"hello world"被存储在运行时常量池。通过这种方式来将String对象跟引用绑定的话，JVM会先在运行时常量池查找是否存在相同的字面常量，如果存在，则直接将引用指向已经存在的字面常量；否则在运行时常量池开辟一个空间来存储该字面常量，并将引用指向该字面常量。
　　通过new关键字来生成对象是在堆进行的，而在堆对象生成的过程是不会去检测该对象是否已存在的。因此通过new来创建对象，创建出的一定是不同的对象，即使字符串的内容是相同的。
9.2 Case II
String a = "hello2"; 　　
String b = "hello" + 2; 　　
System.out.println((a == b));

　　true。b在编译期间就已经被优化成"hello2"，因此在运行期间，变量a和变量b指向的是同一个对象。
9.3 Case III
String a = "hello2"; 
String b = "hello";    
String c = b + 2;     
System.out.println((a == c));

　　false。由于有符号引用的存在，所以c不会在编译期间被优化，不会把b + 2当做字面常量来处理的，因此生成的对象是保存在堆上的。
9.4 Case IV
String a = "hello2"; 
final String b = "hello"; 
String c = b + 2; 
System.out.println((a == c));

　　true。被final修饰的变量，会在class文件常量池中保存一个副本，不会通过连接而进行访问。对final变量的访问在编译期间都会直接被替代为真实的值。那么String c = b + 2在编译期间就会被优化成String c = "hello" + 2。
9.5 Case V
 String a = "hello2"; 
 final String b = getHello(); 
 String c = b + 2;   
 System.out.println((a == c));

　　false。虽然b用final修饰，但由于其赋值是通过方法调用返回的，那么它的值只能在运行期间确定，因此a和c指向的不是同一个对象。

