Concurrent

1. 线程的五个状态wait和sleep区别：


新建(new)：新创建了一个线程对象。
可运行(runnable)：线程对象创建后，其他线程调用了该对象的start()，该状态的线程位于可运行线程池中，等待被线程调度选中，获取cpu使用权 。
运行(running)：可运行状态(runnable)的线程获得了cpu时间片（timeslice），执行程序。
阻塞(block)：线程因为某种原因放弃了cpu使用权，暂时停止运行，阻塞的情况分三种： 
等待阻塞：运行的线程执行wait()，JVM把该线程放入等待队列(waitting queue)中。
同步阻塞：运行的线程在获取对象同步锁时，若该同步锁被别的线程占用，则JVM会把该线程放入锁池(lock pool)中。
其他阻塞：运行的线程执行Thread.sleep(long ms)或t.join()，或者发出I/O请求时，JVM会把该线程置为阻塞状态。当sleep()状态超时、join()等待线程终止或者超时、或者I/O处理完毕时，线程重新转入可运行(runnable)状态。


死亡(dead)：线程run()、main()方法执行结束，或者因异常退出了run()，则该线程结束生命周期。


　　另外，关于wait()与sleep()区别：

wait()是Object方法，而sleep()是Thread`类的静态方法
sleep()使线程阻塞指定时间，这段时间当前线程让出CPU时间，时间结束后继续执行，该过程不释放线程持有的对象锁；wait()调用后线程释放持有的锁并进入该锁等待队列，当收到持有锁的其它线程notify()或notifyAll()信号后，wait()方法返回。

