3. 非阻塞算法
　　基于锁的算法会带来一些活跃度失败的风险。如果线程在持有锁的时候因为阻塞I/O，页面错误，或其他原因发生延迟，很可能所有的线程都不能前进了。 
　　一个线程的失败或挂起不应该影响其他线程的失败或挂起，这样的算法为非阻塞（nonblocking）算法；如果算法的每一个步骤中都有一些线程能够继续执行，那么这样的算法称为锁自由（lock-free）算法。在线程间使用CAS进行协调，这样的算法如果能构建正确的话，它既是非阻塞的，又是锁自由的。非竞争的CAS总是能够成功，如果多个线程以一个CAS竞争，总会有一个胜出并前进。
　　非阻塞算法通过使用低层次的并发原语，比如比较交换，取代了锁。 
4. 可重入锁ReentrantLock
　　ReentrantLock由最近成功获取锁，还没有释放的线程所拥有，当锁被另一个线程拥有时，调用lock()方法的线程可以成功获取锁。如果锁已经被当前线程拥有，当前线程会立即返回。
　　在AQS里面有一个state字段，在ReentrantLock中表示锁被持有的次数，它是一个volatile类型的整型值。一个线程持有锁，state = 1,如果它再次调用lock()，那么state = 2.当前可重入锁要完全释放，调用了多少次lock()，还得调用等量的unlock()来释放锁。
　　ReentrantLock默认是nonfair，Synchronizer是fair. ReentrantLock当中的lock()是通过static内部类sync来进行锁操作：
public void lock() {
     sync.lock();
}
//定义成final型的成员变量，在构造方法中进行初始化 
private final Sync sync;
//无参数默认非公平锁
public ReentrantLock() {
    sync = new NonfairSync();
}
//根据参数初始化为公平锁或者非公平锁 
public ReentrantLock(boolean fair) {
    sync = fair ? new FairSync() : new NonfairSync();
}

5. 如何让一段程序并发执行，并最终汇总结果？

CountDownLatch：允许一个或者多个线程等待前面的一个或多个线程完成，构造一个CountDownLatch时指定需要CountDown的点的数量，每完成一点就count down一下，当所有点都完成，latch.wait就解除阻塞。
CyclicBarrier：可循环使用的Barrier，它的作用是让一组线程到达一个Barrier后阻塞，直到所有线程都到达 Barrier后才能继续执行。CountDownLatch的计数值只能使用一次，CyclicBarrier可以通过使用reset重置；还可以指定 到达栅栏后优先执行的任务。
fork/join框架，fork把大任务分解成多个小任务，然后汇总小任务的结果得到最终结果。使用一个双端队列，当线程空闲时从双端队列的另一端领取任务。

6. 为什么wait(), notify()和notifyAll()必须在同步方法或同步块中被调用？
　　当一个线程需要调用对象的wait()时，这个线程必须拥有该对象的锁，接着它就会释放这个对象锁并进入等待状态直到其他线程调用这个对象上的notify()。
　　同样的，当一个线程需要调用对象的notify()时，它会释放这个对象的锁，以便其他在等待的线程就可以得到这个对象锁。由 于所有的这些方法都需要线程持有对象的锁，就只能通过同步来实现，所以他们只能在同步方法或者同步块中被调用。
