8. CopyOnWriteArrayList适用场景？
　　CopyOnWriteArrayList（写时复制）是一个线程安全的容器，它的线程安全性在于对容器的修改可以和读操作同时进行。从容器中读时不需要加锁，对容器中的元素进行修改时，先复制一份所有元素的副本，然后在新的副本上进行操作。 
　　CopyOnWriteArrayList适用于读操作多于写操作的场景。例如，缓存。
9. Java多线程内存模型Memory Model
　　JVM中存在一个主内存（Main Memory），Java中所有的变量存储在主内存中，所有实例和实例的字段都在此区域，对于所有的线程是共享的（相当于黑板，其他人都可以看到的）。
　　每个线程都有自己的工作内存（Working Memory），工作内存中保存的是主存中变量的拷贝，（相当于自己笔记本，只能自己看到），工作内存由缓存和堆栈组成，其中缓存保存的是主存中的变量的copy，堆栈保存的是线程局部变量。
　　线程对所有变量的操作都是在工作内存中进行的，线程之间无法直接互相访问工作内存，变量的值得变化的传递需要主存来完成。在JMM中通过并发线程修改的变量值，必须通过线程变量同步到主存后，其他线程才能访问到。

　　线程对某个变量的操作步骤： 

从主内存中复制数据到工作内存；
执行代码，对数据进行各种操作和计算；
把操作后的变量值重新写回主内存中。

　　这三个步骤顺序是我们希望的，但JVM不保证第1步和第3步会严格按照上述次序立即执行。由于JVM可以对特征代码进行调优，也就改变了某些运行步骤的次序的颠倒，那么每次线程调用变量时是直接取自己的工作存储器中的值还是先从主存储器复制再取是没有保证的，任何一种情况都可能发生。同样的，线程改变变量的值之后，是否马上写回到主存储器上也是不可保证的 。
　　在多线程的应用场景下同时访问同一个代码块，有可能某个线程已经改变了某变量值，当然现在的改变仅仅是局限于工作内存中的改变，此时JVM并不能保证将改变后的值立马写到主内存中去，也就意味着有可能其他线程不能立马得到改变后的值，依然在旧的变量上进行各种操作和运算，最终导致不可预料的结果。 
　　还好有synchronized和volatile： 

多个线程共有的字段应该用synchronized或volatile来保护. 
synchronized负责线程间互斥。即同时只有一个线程可以执行synchronized中的代码. 

　　synchronized还有另外的作用：

在线程进入synchronized块之前，会把工作存内存中的所有内容映射到主内存上，然后把工作内存清空再从主存储器上拷贝最新的值。
线程退出synchronized块时，会把工作内存中的值映射到主内存，此时并不会清空工作内存。强制其按照上面的顺序运行，以保证线程在执行完代码块后，工作内存中的值和主内存中的值是一致的，保证了数据的一致性。 
volatile负责线程中的变量与主存储区同步.但不负责每个线程之间的同步. 

10. 确定CPU密集型／IO密集型线程数 Multiple CPU/IO Threads Work
　　首先要考虑系统可用的处理器核心数：Runtime.getRuntime().availableProcessors()。应用程序最小线程数等于可用的处理器核数。
　　如果所有的任务都是计算密集型的，则创建处理器可用核心数这么多个线程就可以了 。创建更多的线程对于程序性能反而是不利的，因为多个线程间频繁进行上下文切换对于程序性能损耗较大。
　　如果任务都是IO密集型的，就需要创建比处理器核心数大几倍的线程。当一个任务执行IO操作时，线程将被阻塞，处理器可以立即进行上下文切换以便处理其他就绪线程。如果只有处理器核心数那么多个线程，即使有待执行的任务也无法调度处理。
　　因此，线程数与任务处于阻塞状态的时间比例相关。任务有50%时间处于阻塞状态，那程序所需线程数是处理器核心数的两倍。计算程序所需的线程数公式如下：
线程数=CPU可用核心数/（1 - 阻塞系数），阻塞系数在0到1内（CPU密集型阻塞系数为0，IO密集型程阻塞系数接近1） 
You really can't improve on having one thread reading the file sequentially. With one thread, you do one seek and then one long sequential read; with multiple threads you're going to have the threads causing multiple seeks as each gains control of the disk head.
