class CPUTask implements Runnable {
    private final BlockingQueue queue;

    public CPUTask(BlockingQueue queue) {
        this.queue = queue;
    }

    @Override
    public void run() {
        String line;
        while(true) {
            try {
                // block if the queue is empty
                line = queue.take(); 
                // do things with line
            } catch (InterruptedException ex) {
                break; // FileTask has completed
            }
        }
        // poll() returns null if the queue is empty
        while((line = queue.poll()) != null) {
            // do things with line;
        }
    }
}

11. volatile作用
　　volatile解决变量的可见性问题。如果一个变量被声明为volatile，那么编译器和JVM就会把该变量当做共享变量从而禁止对该变量的一些重排序操作。修改volatile变量后立刻对所有线程可见 。
　　volatile无法解决原子性问题和一致性问题。可以用于确保自身状态的可见性，例如检查一个volatile变量以确定是否退出循环，如果该变量被其它变量修改，那么这个线程可以马上检查到。使用 volatile可以简化多线程编程，例如ConcurrentHashMap中HashEntry中的val域和next通过使 用volatile减少锁的获取和释放引起的损失。
12. 什么是daemon线程
A daemon thread runs in background and doesn’t prevent JVM from terminating. When there are no user threads running, JVM shutdown the program and quits.
　　必须在Thread启动前调用setDaemon()将线程设置为Daemon线程：

Daemon线程创建的线程也是Daemon线程
Daemon不应该访问数据库、文件等资源，因为它随时有可能被中断（后台进程在不执行finally语句前就可以中断其run()）

13. 针对外星方法的保护性锁
　　例: 构造一个类从一个URL进行下载，并用ProgressListeners监听下载的进度：
class Downloader extends Thread {
    private InputStream in;
    private OutputStream out;
    private ArrayList listeners;

    public Downloader(URL url, String outputFilename) throws IOException {
        in = url.openConnection().getInputStream();
        out = new FileOutputStream(outputFilename);
        listeners = new ArrayList();
    }

    public synchronized void addListener(ProgressListener listeners) {
        listeners.add(listener);
    }

    public synchronized void removeListener(ProgressListener listener) {
        listeners.remove(listener);
    }

    private synchronized void updateProgress(int n) {
        for (ProgressListener listener: listeners)
            listener.onProgress(n);   // 这里调用了一个外星方法
    }

    public void run() {
        int n = 0, total = 0;
        byte[] buffer = new byte[1024];

        try {
            while ((n = in.read(buffer)) != -1) {
                out.write(buffer, 0, n);
                total += n;
                updateProgress(total);
            }
            out.flush();
        } catach (IOException e) {}
    }
}


问题：调用了onProgress()这个外星方法，可能引入其他锁导致死锁。
解决方案：采用保护性复制（defensive copy），即不对原始对象进行操作，而是对克隆出来的对象进行操作。
注意：保护性复制是个好方法。前提是进行只读的操作，不做修改。

private void updatePrgress(int n) {
    ArrayList listernersCopy;
    synchronized(this) {
        listernersCopy = (ArrayList)listeners.clone();
    }
    for (ProgressListener listener : listernersCopy)
        listener.onProgress(n);
}

14. BlockingQueue
BlockingQueue doesn’t accept null values and throw NullPointerException if store null value in the queue.
　　BlockingQueue是接口，使用它应类似BlockingQueue q = new LinkedBlockingQueue(5);常用的阻塞队列有:

ArrayBlockingQueue：由数组支持的有界阻塞队列，其构造函数必须带一个参数来指明其大小.其所含的对象是以FIFO顺序排序的。之所以采用阻塞队列，是因为如果生产者的速度比消费者快很多，很容易就占用大量内存空间.
LinkedBlockingQueue：其构造函数可带也可不带规定大小的参数。 若不带大小参数,所生成的大小由Integer.MAX_VALUE决定.所含对象以FIFO排序。
PriorityBlockingQueue：类似于LinkedBlockQueue,但其所含对象的排序是依据对象的自然排序顺序或者是构造函数的Comparator决定的顺序。
SynchronousQueue：对其的操作必须是放和取交替完成的。 

　　其入队出队方法：

add(Object): 如果BlockingQueue可以容纳,则返回true,否则异常
offer(Object): 如果BlockingQueue可以容纳,则返回true,否则返回false.
put(Object): 如果BlockQueue没有空间,则调用此方法的线程被阻断直到BlockingQueue里面有空间再继续.
poll(time):取走排在首位的对象,若不能立即取出,则可以等time参数规定的时间,取不到时返回null。
take():取走排在首位的对象,若BlockingQueue为空,阻断进入等待状态直到有新的对象被加入为止

　　原理：

ArrayBlockingQueue是一个由数组支持的有界阻塞队列。 创建时默认非公平锁，不过可在它的构造函数里指定,因为调用ReentrantLock的构造函数创建锁。
SynchronousQueue同步队列没有任何内部容量。不能在同步队列上进行peek()，因为仅在试图要取得元素时，该元素才存在；除非另一个线程试图移除某个元素，否则也不能使用任何方法添加元素；也不能迭代队列，因为其中没有元素可用于迭代。
LinkedBlockingQueue是一个基于已链接节点的、范围任意的blocking queue。队列的头部是在队列中时间最长的元素。队列的尾部是在队列中时间最短的元素。新元素插入到队列的尾部，队列检索操作会获得位于队列头部的元素。链接队列的吞吐量通常要高于基于数组的队列，但是在大多数并发应用程序中，其可预知的性能要低。

15. ThreadLocal?
ThreadLocal is used to create thread-local variables. We know that all threads of an Object share its variables, so if the variable is not thread safe, we can use synchronization but if we want to avoid synchronization, we can use ThreadLocal variables.
Every thread has its own ThreadLocal variable and they can use its get() and `set() to get the default value or change its value local to Thread. ThreadLocal instances are typically private static fields in classes that wish to associate state with a thread.
　　ThreadLocal是一种以空间换时间的做法，在每个Thread里面维护了一个以开地址法实现的ThreadLocal.ThreadLocalMap，把数据进行隔离，数据不共享。
