public class Mutex {
    private boolean isLocked = false;
    public synchronized void lock() {
        while(this.isLocked) //使用while可以避免线程 假唤醒
            wait();
        this.isLocked= true;
    }
}

public synchronized void unlock() throws InterruptedException{
    this.isLocked= false;
    this.notify();
    }
}

20. 线程类的构造方法、静态块是被哪个线程调用的
　　线程类的构造方法、静态块是被new这个线程类所在的线程所调用的，而run()里面的代码才是被线程自身所调用的。
　　举个例子，假设Thread2中new了Thread1，main()中new了Thread2，那么：

Thread2的构造方法、静态块是main线程调用的，Thread2的run()是Thread2自己调用的。
Thread1的构造方法、静态块是Thread2调用的，Thread1的run()是Thread1自己调用的。

21. What is happens-before?
　　程序都要经过编译器和处理器优化后才会被运行，优化分为很多种，其中有一种优化叫做重排序，重排序需要遵守happens-before规则:

程序次序法则，如果A一定在B之前发生，则happen before,
监视器法则,对一个监视器的解锁一定发生在后续对同一监视器加锁之前 
volatie变量法则：写volatile变量一定发生在后续对它的读之前 
线程启动法则：Thread.start一定发生在线程中的动作 
中断法则：一个线程调用另一线程的interrupt一定发生在另一线程发现中断。
终结法则：一个对象的构造函数结束一定发生在对象的finalizer之前 
传递性：A发生在B之前，B发生在C之前，A一定发生在C之前。

22. 什么是线程安全
　　如果代码在多线程和在单线程下执行永远获得一样的结果，那么就是线程安全。线程安全也有几个级别：

不可变：像String、Integer、Long都是final类型的类，任何一个线程都改变不了它们的值，因此这些不可变对象不需要任何同步手段就可以直接在多线程环境下使用。
绝对线程安全：不管运行时环境如何，调用者都不需要额外的同步措施。要做到这一点需付出额外代价，比方说CopyOnWriteArrayList、CopyOnWriteArraySet。
相对线程安全：就是通常意义上所说的线程安全，像Vector，add()、remove()都是原子操作。如果有个线程在遍历某个Vector、有个线程同时在add这个Vector，99%的情况下都会出现ConcurrentModificationException，也就是fail-fast机制。

