　　上述逻辑主要包括：

尝试获取（调用tryAcquire更改状态，需要保证原子性）: 在tryAcquire中利用compareAndSet保证只有一个线程能够对状态进行成功修改，而没有成功修改的线程将进入sync队列排队。
如果获取不到，将当前线程构造成节点Node并加入sync队列；进入队列的每个线程都是一个节点Node，从而形成了一个类似CLH双向队列， 这样做的目的是线程间的通信会被限制在较小规模（也就是两个节点左右）。
再次尝试获取，如果没有获取，那么将当前线程从线程调度器上摘下，进入等待状态。使用LockSupport将当前线程unpark。

2.1 如果尝试获取失败，添加进队列
    private Node addWaiter(Node mode) {
        Node node = new Node(Thread.currentThread(), mode);
        // Try the fast path of enq; backup to full enq on failure
        Node pred = tail;
        if (pred != null) {
            node.prev = pred;
            if (compareAndSetTail(pred, node)) {
                pred.next = node;
                return node;
            }
        }
        enq(node);
        return node;
    }
    private Node enq(final Node node) {
        for (;;) {
            Node t = tail;
            if (t == null) { // Must initialize
                if (compareAndSetHead(new Node()))
                    tail = head;
            } else {
                node.prev = t;
                if (compareAndSetTail(t, node)) {
                    t.next = node;
                    return t;
                }
            }
        }
    }

　　上述逻辑主要包括：

使用当前线程构造Node；将当节点前驱节点指向尾节点（current.prev = tail），尾节点指向它（tail = current），原有的尾节点的后继节点指向它（t.next = current）而这些操作要求是原子的。上面的操作是利用尾节点的设置来保证的，也就是compareAndSetTail来完成的。
先行尝试在队尾添加Node；如果尾节点已经有了：
分配引用T指向尾节点；
将节点的前驱节点更新为尾节点（current.prev = tail）；
如果尾节点是T，将尾节点设置为该节点（tail = current，原子更新）；
T的后继节点指向当前节点（T.next = current）。


如果队尾添加失败或者是第一个入队的节点：如果是第1个节点，会进入到enq方法，进入的线程可能有多个，或者说在addWaiter中没有成功入队的线程都将进入enq方法。enq的逻辑是确保进入的Node都会有机会顺序的添加到sync队列中，而加入的步骤如下：
如果尾节点为空，那么原子化的分配一个头节点，并将尾节点指向头节点，这一步是初始化；
然后是重复在addWaiter中做的工作，但是在一个while(true)的循环中，直到当前节点入队为止。



　　进入sync队列之后，接下来就是要进行锁的获取，只有一个线程能够在同一时刻继续的运行，而其他的进入等待状态。而每个线程都是一个独立的个体，它们自省的观察，当条件满足的时候（自己的前驱是头结点并且原子性的获取了状态），那么这个线程能够继续运行。
