CLH(Craig, Landin, and Hagersten)队列


implements Lock
尾指针为AtomicReference类型，调用getAndSet()保证原子更新对象引用
CLH Lock是一个自旋锁，可保证无饥饿以及公平
锁本身为QNode虚拟链表。
共享的tail保存申请的最后的一个申请lock的线程的myNode域。
每个申请lock的线程通过一个本地线程变量(ThreadLocal)pred指向前驱。另外一个本地线程变量myNode的locked保存本身的状态，true表示正在申请锁或已申请到锁；false已释放锁。
每个线程通过监视自身的前驱状态，自旋等待锁被释放。释放锁时，把自身myNode的locked设为false，使后继线程获的锁，并回收前驱的QNode。


举例：线程A需要获取锁，其myNode域为true，tail指向线程A的结点，然后线程B也加入到线程A后面，tail指向线程B的结点。然后线程A和B都在它的myPred域上旋转，直到myPred结点的locked字段变为false，它就可以获取锁扫行。然后，线程A的myPred的locked域为false，此时线程A获取到了锁。

public class CLHLock implements Lock {  
    AtomicReference tail = new AtomicReference(new QNode());  
    ThreadLocal myPred;  
    ThreadLocal myNode;  

    public CLHLock() {  
        tail = new AtomicReference(new QNode());  
        myNode = new ThreadLocal() {  
            protected QNode initialValue() {  
                return new QNode();  
            }  
        };  
        myPred = new ThreadLocal() {  
            protected QNode initialValue() {  
                return null;  
            }  
        };  
    }  

    @Override  
    public void lock() {  
        QNode qnode = myNode.get();  
        qnode.locked = true;  
        QNode pred = tail.getAndSet(qnode);  
        myPred.set(pred);  
        while (pred.locked) {  
        }  
    }  

    @Override  
    public void unlock() {  
        QNode qnode = myNode.get();  
        qnode.locked = false;  
        myNode.set(myPred.get());  
    }  
}

