首先判断当前状态: 如果c == 0说明没有线程正在竞争该锁，如果不c != 0说明有线程拥有了锁。
如果c == 0，通过CAS设置该状态值为acquires, acquires的初始调用值为1，每次线程重入该锁都会+1，每次unlock都会-1，但为0时释放锁。如果CAS设置成功，则可以预计其他任何线程调用CAS都不会再成功，也就认为当前线程得到了该锁 。
