一个线程在get，另一个线程对同一个key的node进行remove；
一个线程在get，另一个线程正重排table。可能导致旧table取不到值。

　　本质是在get时，有其他线程在对同一桶的链表或树进行修改。那么get是怎么保证同步性的呢？我们看到e = tabAt(tab, (n - 1) & h)) != null，tablAt是对tab[i]进行原子性读取.不需要加锁是因为用了Unsafe.getObjectVolatile，因为table是volatile，所以对tab[i]的原子请求也是可见的。根据happens-before原则，对volatile域的写入操作happens-before于每一个后续对同一域的读操作。所以不管其他线程对table链表或树的修改，都对get读取可见。 
